import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';
import Navigation from './components/Navigation';
import Galarie from './pages/Galarie';
import Kontakt from './pages/Kontakt';
import Oeffnungszeiten from './pages/Oeffnungszeiten';
import Speisekarte from './pages/Speisekarte';
const styles = {
  header: {
    height: 48,
    width: "100%",
    backgroundColor: "#faeee7",
    color: "white",
    padding: "6px 10px",
    display: "flex",
    flexDirection: "row",
    alignItems: "center"
  },
  logoBereich: {
    float: "left"
  },
  logo: {
    width: "50px",
    height: "50px",
    borderRadius: "10px"
  },
  navText: {
    color: "#ffbbcc",
    fontSize: "30px",
    margin: "0 10px"
  },
  dunkelButton: {
    fontFamily: "Lobster",
    fontSize: "15px",
    background: "#5eb7b7",
    border: "2px solid #ffbbcc",
    display: "block",
    height: "50px",
    margin: "10px",
    padding: "2px 25px",
    textDecoration: "none",
    borderRadius: "30px",
    lineHight: "45px",
    color: "#fffdf9",
    cursor: "pointer"
  },
  hellButton: {
    fontFamily: "Lobster",
    fontSize: "15px",
    background: "#9be3de",
    border: "2px solid #ffbbcc",
    display: "block",
    height: "50px",
    margin: "10px",
    padding: "2px 25px",
    textDecoration: "none",
    borderRadius: "30px",
    lineHight: "45px",
    color: "#fffdf9",
    cursor: "pointer"
  },
  rechtButtons: {
    float: "right",
    paddingRight: 20,
    width: "550px",
    display: "flex"
  },
  leerenPlatz: { float: "left", flex: 1 }
};

function App() {
  return (
    <div className="App">
      <Router>
        <Navigation />
        <Routes>
          <Route path="/galarie" element={<Galarie />} />
          <Route path="/kontakt" element={<Kontakt />} />
          <Route path="/oeffnungszeiten" element={<Oeffnungszeiten />} />
          <Route path="/speisekarte" element={<Speisekarte />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
